import ReactPlayer from "react-player"


import React from 'react'

const VideoPlayer = () => {
    return (
        <div className = "player-wrapper">
            <ReactPlayer className="react-player"
            url="https://www.youtube.com/watch?v=ZdDEvLgxQDQ&t=1s"
            width="100%"
            height = "100%"
            controls = {true}
            />
            
        </div>
    )
}

export default VideoPlayer
